import Vue from "vue";
import Router from "vue-router";
import home from "@/views/prestataires/home.vue";

Vue.use(Router);

let prestataireRouter = new Router({
    mode: "history",
    base: process.env.BASE_URL,
    routes: [
        {
            path: "/",
            name: "home",
            component: home,
        }
    ],
});
export default prestataireRouter;
